import React from 'react';
import './Note.css'

function Note({ note, deleteNote }) {
  return (
    <div className="note">
      <p>{note.text}</p>
      <button onClick={() => deleteNote(note.id)}>Delete</button>
    </div>
  );
}

export default Note;
